'use strict';

/**
* Natural logarithm of the probability density function (PDF) for a chi distribution.
*
* @module @stdlib/math/base/dist/chi/logpdf
*
* @example
* var logpdf = require( '@stdlib/math/base/dist/chi/logpdf' );
*
* var y = logpdf( 2.0, 1.0 );
* // returns ~-2.226
*
* @example
* var factory = require( '@stdlib/math/base/dist/chi/logpdf' ).factory;
*
* var logpdf = factory( 6.0 );
*
* var y = logpdf( 3.0 );
* // returns ~-1.088
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var logpdf = require( './logpdf.js' );
var factory = require( './factory.js' );


// MAIN //

setReadOnly( logpdf, 'factory', factory );


// EXPORTS //

module.exports = logpdf;
